, "december"]
    const month = monthArray[props.time.getMonth()];
    const year = props.time.getFullYear()
    return (
       <div>
          <div>{month}</div>
          <div>{props.time.getMonth()}</div>
          <div>{props.time.getDate()}</div>
       </div>
    );
}

export default Time;
